class TopWindow:

    def __init__(self, config):
        import PySimpleGUIQt as qt
        self.placeholder = '--|--'
        self.qt = qt
        self.config = config
        self.window = qt.Window('Looking Glass', layout=self._layout_(), background_color='black')

    def _button_frame_(self):
        refresh_icon = b''
        """
        Create a frame for our buttons at the bottom of the window

        :returns: Button frame object
        :rtype:
        """
        b_frame = [
            [self.qt.Button('Fetch Device Data', key='fetch_device_info', enable_events=True), self.qt.Button('Exit', key='top_win_exit')]
        ]
        return b_frame

    def _sense_frame_(self, config):
        placeholder = self.placeholder
        qt = self.qt
        device_name = '-- | --'

        struct = [[qt.Text(f'Current Interior Temperature in {placeholder}', background_color='black'),
                   qt.Text(placeholder, key='test_field', justification='right', background_color='black'), ],
                  [qt.Text(f'Current humidity in {placeholder}', background_color='black'),
                   qt.Text(f"{placeholder}%", key='humidity_results', justification='right', background_color='black')],
                  [qt.Text(f"Current barometric pressure in {placeholder}", background_color='black'),
                   qt.Text(placeholder, key='pressure_results', background_color='black'),
                   qt.Text('MB', background_color='black')]
                  ]
        return struct

    def _layout_(self):
        from lib.gui.menus import top
        import PySimpleGUIQt as qt
        top = top.TopMenu()
        top_menu = top.menu
        struct = [
            [qt.Menu(top_menu)],
            [qt.Text('Welcome to LookingGlass!', background_color='black')],
            # ToDo:
            #     Populate the combo field with actual data from the config or no data. There should, however, be an
            #     item placed within (whether the user has devices set-up or not) called "Add Device" which should -
            #     as the name suggests - allow one to add a device to their config-file, and therefore allow said
            #     device to be set-up and managed by adaSense
            [qt.Combo(['Add Device'], key='device_combo')],
            [qt.Frame('', self._sense_frame_(self.config), background_color='black')],
            [qt.Frame('', list(self._button_frame_()), background_color='black')]
        ]

        return struct
